import React from 'react';

const Header = () => {
    return (
        <nav className="Header d-flex justify-content-between">
            <div>
                <h1>Star DB</h1>
            </div>
            <div>
                <a href="#">People</a>
                <a className="ml-5" href="#">Planets</a>
                <a className="ml-5" href="#">Starship</a>
            </div>
        </nav>
    )
};

export default Header;
